    // const boxStyle = {
    //   height: this.props.height,
    //   padding: this.props.padding,
    //   ...style,
    // };

    return (
      <WidgetBox
        className="isoWidgetBox"
        height={height}
        padding={padding}
        style={style}
      >
        {children}
      </WidgetBox>
    );
  }
}
